import React from 'react';
import CountriesStatics from '../CountriesStatics';
import { GeoContext } from '../Context';
import '../countriesStatistic.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <GeoContext>
        <CountriesStatics />
      </GeoContext>
    </div>
  );
}

export default App;
